INSERT INTO `clanak` (`archive`, `clanak_id`, `author`, `category`, `heading`, `dateOfUpload`, `articleSummary`, `article`, `pic`, `img_path`) VALUES
(0, 16, 'mdrcic01', 'politika', 'Rusi u Donbas su poslali uboji', '2022-05-23 10:23:34', 'Vozilo je razvijeno nakon velikih gubitaka.', '- Uključeni su u uništavanje ukrajinskih položaja, oklopnih vozila i posada protutenkovskih raketnih sustava - rekao je obrambeni izvor državnoj novinskoj agenciji RIA Novosti. Riječ je o teško naoružanom borbenom vozilu na gusjenicama kojemu na Zapadu nema pandana. Vozilo je naoružano s dva automatska topa kalibra 30 mm, navođenim protuoklopnim raketama i strojnicama, a pogon, oklop i podvozje preuzeti su od tenka T-72.\r\n\r\nVozilo je razvijeno nakon velikih gubitaka koje su ruske oklopne snage pretrpjele u gradskim borbama tijekom operacija u Čečeniji sredinom 1990-ih i početkom 2000-ih. Vozilo se po nepristupačnom terenu može kretati brzinom od 60 km/h. U stanju je prelaziti rovove, rušiti i prelaziti zidove visoke metar i pol, a njegov proizvođač Uralvagonzavod ga je prozvao Terminator.', , 'img/tenk.JPG');
INSERT INTO `clanak` (`archive`, `clanak_id`, `author`, `category`, `heading`, `dateOfUpload`, `articleSummary`, `article`, `pic`, `img_path`) VALUES
(0, 17, 'jleljak', 'politika', 'Vučić: Srbi nisu ubijali Hrvat', '2022-05-23 10:39:39', '\"Ponosan sam na sve što sam.\"', 'Predsjednik kluba zastupnika HDZ-a Branko Bačić ocijenio je neprihvatljivom izjavu srpskog predsjednika Aleksandra Vučića da u njegovom huškačkom govoru u okupiranoj Glini 1995. nema ništa sporno te da su u Glini Hrvati ubijali Srbe.\r\n\r\n„Pravdanje takvog govora je apsolutno neprihvatljivo“, kazao je Bačić novinarima nakon sjednice predsjedništva i nacionalnog vijeća HDZ-a, dodavši kako „takve izjave ne doprinose dobrosusjedskoj suradnji između dviju država“.', , 'img/Vucic.JPG');
INSERT INTO `clanak` (`archive`, `clanak_id`, `author`, `category`, `heading`, `dateOfUpload`, `articleSummary`, `article`, `pic`, `img_path`) VALUES
(0, 18, 'mdrcic01', 'politika', 'Propada projekt od 441 milijun', '2022-05-23 12:07:14', 'Ministarstvo znanosti ne namjerava produljiti rok ', 'Tražimo rješenje, projekt još nije propao jer i dalje imamo valjani ugovor. Tražit ćemo od Ministarstva znanosti i obrazovanja da nam produlji rok i, ako nam to odobre, projekt ima šanse', , 'img/projekt.JPG');
INSERT INTO `clanak` (`archive`, `clanak_id`, `author`, `category`, `heading`, `dateOfUpload`, `articleSummary`, `article`, `pic`, `img_path`) VALUES
(0, 20, 'mdrcic01', 'nekretnine', 'Novi trend na tržištu nekretni', '2022-05-20 11:50:20', 'Novi trend na tržištu: Ovakve kuće su sve traženij', 'Iako tradicija izgradnji drvenih kuća na prostoru Hrvatske postoji već stoljećima unazad tek se zadnjih nekoliko godina sve više na tržištu govori o drvenim kućama i prednostima koje one donose. U isto vrijeme drvene kuće su u zemljama zapadne Europe i svijetu postale uobičajena pojava pa se tako već naveliko grade cijela naselja izgrađena od drveta kao i višestambene zgrade. Slijedom toga i neke tvrtke s područja Hrvatske krenule su s izgradnjom drvenih kuća na tržište Hrvatske ali prije svega Europe. Jedna od takvih je i tvrtka Arkada Interijeri iz Vinkovaca čiji vlasnik Ivo Miličić kaže kako tvrtka pravi drvene kuće za zemlje Švicarske, Njemačke, Francuske, Austrije…', , 'img/Beautiful-DIY-wood-tree-house-decor.jpg');
INSERT INTO `clanak` (`archive`, `clanak_id`, `author`, `category`, `heading`, `dateOfUpload`, `articleSummary`, `article`, `pic`, `img_path`) VALUES
(0, 23, 'mdrcic01', 'politika', 'Tomašević završio dvodnevni po', '2022-05-23 09:59:59', 'Naglasak je bio na priuštivom stanovanju i sl.', '“Naglasak je bio na priuštivom stanovanju, gospodarenju otpadom, prometu, posebno biciklističkom, javnom prijevozu, te ostalim temama zajedničkim velikim gradovima”, rekao je gradonačelnik Tomašević, koji je pozvao gradonačelnicu Giffey u posjet Zagrebu. U sklopu posjete, Tomašević je sudjelovao na konferenciji “Što je zeleni narativ?\", na kojoj je govorio na temu “Europske zelene stranke i odgovornost”. Razgovaralo se o odgovornosti „zelenih“ političara, te o zadaćama, izazovima i problemima s kojima se susreću.', , 'img/tomasevic.JPG');
INSERT INTO `clanak` (`archive`, `clanak_id`, `author`, `category`, `heading`, `dateOfUpload`, `articleSummary`, `article`, `pic`, `img_path`) VALUES
(0, 24, 'mdrcic01', 'nekretnine', 'Prodaje se otočić u Jadranu', '2022-05-24 16:04:22', 'Hrvatska bi na sličnim otočićima mogla zaraditi', 'Zainteresiranih je kupaca, kaže vlasnica agencije za nekretnine Jasminka Biliškov, itekako bilo. Ipak, svi su vrlo brzo odustali kada su shvatili da prostornim planom nije dozvoljeno građenje i kada bi se upoznali s propisima prostornog planiranja. Otok, kojeg je ekipa N1 televizije posjetila, okružen je oštrim stijenama te je na njega nemoguće pristati. U unutrašnjosti ima makiju i nisko raslinje. Iz Splitsko-dalmatinske županije kažu da je pogodan isključivo za bavljenje poljoprivredom. Mišljenja mještana su podijeljena - jednu smatraju da se ne bi trebao prodavati, posebno strancima, dok drugi s time nemaju problema. Agentica za nekretnine Jasminka Biliškov smatra da bi Hrvatska na sličnim otočićima mogla zaraditi ako dođe do promjene zakona i prostornoga plana. Do rasprodaje hrvatskih otoka, ipak, neće doći. Naime, činjenica je da se ne prodaje otok, nego zemljište na otoku. Njegova je obala pomorsko dobro kojim upravlja županija, a nitko ne može biti njegov vlasnik.', , 'img/otocic.JPG');
INSERT INTO `clanak` (`archive`, `clanak_id`, `author`, `category`, `heading`, `dateOfUpload`, `articleSummary`, `article`, `pic`, `img_path`) VALUES
(0, 25, 'mdrcic01', 'nekretnine', 'Pogledajte koliko su lani rasl', '2022-05-25 18:26:40', 'Prosjecna cijena stana - 13.713 kuna', 'U Zagrebu je pritom prosječna cijena četvornog metra novog stana bila 14.672 kune, što je 4.7 posto više nego godinu prije, a u ostalim naseljima 12.577 kuna ili 12.3 posto više. Prosječna cijena kvadrata novog stana koje su prodavala trgovačka društva i druge pravne osobe, bez programa društveno poticane stanogradnje (POS), u 2021. dosezala je 13.843 kune, što je 7.6 posto više u odnosu na 2020. godinu.\r\n\r\nCijena kvadrata tih stanova u Zagrebu je porasla za 4.6 posto, na 14.891 kunu, a u ostalim naseljima za 12.1 posto, na 12.627 kuna. Prosječna cijena četvornog metra POS-ovih stanova lani je, pak, bila 7.642 kune i bila je 0.8 posto niža u odnosu na godinu prije.\r\n\r\nU Zagrebu je iznosila 7.689 kuna, što je porast za 2.3 posto, dok je u ostalim naseljima pala za 7.2 posto, na 7.472 kune.\r\n\r\nU 2021. u Hrvatskoj je prodano 4.678 novih stanova, od čega 2.594 u Zagrebu i 2.084 u drugim naseljima. Od ukupnog broja prodanih stanova, njih 82 su POS-ovi, a 4.596 prodala su trgovačka društva i druge pravne osobe.', , 'img/stan.JPG');
INSERT INTO `clanak` (`archive`, `clanak_id`, `author`, `category`, `heading`, `dateOfUpload`, `articleSummary`, `article`, `pic`, `img_path`) VALUES
(0, 29, 'mdrcic01', 'nekretnine', 'Raste trgovina komercijalnih n', '2022-05-25 14:20:36', 'VOLUMEN investicijskih transakcija porastao za 40%', 'Promatrano geografski, najjača transakcijska aktivnost na tržištu komercijalnih nekretnina u 2021. bila je u Dalmaciji, s oko 40 posto od ukupnog volumena, zatim u Zagrebu s 25 posto udjela, a ostalo se odnosi na ostale dijelove zemlje.\r\n\r\nS obzirom na kapital i investitore, najveći dio ukupnih transakcija na nekretninskom tržištu u 2021., ili 75 posto, činio je strani kapital, pri čemu iz Colliersa ističu da je najveća transakcija bila akvizicija grupacije Sunce hoteli (s brendom Bluesun Hotels & Resorts) privatnog ulagača sa sjedištem u UAE-u i razvojne tvrtke Eagle Hills.\r\n\r\nTako su, po zemljama investitora, oni iz UAE-a (Ujedinjeni Arapski Emirati) 2021. bili na prvom mjestu, s udjelom u transakcijama na nekretninskom tržištu od 29 posto, a na drugom su mjestu investitori iz Hrvatske s udjelom od 25 posto.\r\n\r\nNa trećem su mjestu investitori iz Poljske s udjelom u ukupnim transakcijama od 17 posto, a uz njih, kako kažu iz Colliersa, prilično aktivni na tržištu komercijalnih nekretnina u Hrvatskoj 2021. bili su i investitori iz još nekih zemalja srednje i istočne Europe, pogotovo u sektoru maloprodaje. Tako poljske po udjelima u transakcijama slijede investitori iz Češke s udjelom od 10 posto te Austrije s udjelom od 7 posto.', , 'img/stanovi.JPG');
INSERT INTO `clanak` (`archive`, `clanak_id`, `author`, `category`, `heading`, `dateOfUpload`, `articleSummary`, `article`, `pic`, `img_path`) VALUES
(0, 31, 'mdrcic01', 'nekretnine', 'Subvencije nisu dobre, utječu ', '2022-05-25 09:50:20', 'Tržište nekretnina u Hrvatskoj', '\"Kamata na kredit neće biti uvijek ovako niska\"\r\nKazao je i da ne vidi da bi došlo do kraha kako se mnogi pribojavaju.\r\n\r\n\"Polarizirano je tržište, ne prodaju se sve nekretnine. To je globalna situacija s niskom kamatnom stopom, porastom inflacije koja gura ulagače u nekretnine. Ne vidim da se treba bojati kraha. Doći će ciklus, kamata na kredit neće biti uvijek ovako niska\", rekao je.\r\n\r\n\"Kod nas su kamate nisko na povijesnim razinama. Povećana potražnja je i jer Zagreb ima lokalne uvjete gdje je bio potres pa se traže novije nekretnine\", dodao je Ranilović. Komentirao je i koliko je cijena nekretnina neprirodno napuhana zbog APN-a i toga što država subvencionira kredite.\r\n\r\n\"Subvencije nisu dobre za tržište nekretnina\"\r\n\"Mi smo kao struka govorili da smo protiv subvencija jer one generiraju porast cijena iz prostog razloga što su ročne, u kratkom periodu podižu potražnju i cijene rastu, a onda se to ne vrati nazad u okviru u kojem je bilo. Subvencije nisu dobre za tržište nekretnina i utječu na rast cijena\", kazao je Ranilović.', , 'img/nekr.JPG');
INSERT INTO `clanak` (`archive`, `clanak_id`, `author`, `category`, `heading`, `dateOfUpload`, `articleSummary`, `article`, `pic`, `img_path`) VALUES
(0, 36, 'jleljak', 'politika', 'Skupština: Klub HDZ-a i HSLS-a', '2022-05-25 14:20:47', 'zatražit će podatke o primanjima rukovoditelja Zg', 'Herman se osvrnuo i na stanje u zagrebačkoj Čistoći, gdje je radnika toliko malo da su prisiljeni raditi 10 do 12 sati, a polovica kamiona nisu u funkciji. Poručio kako je evidentno da će se primjena odluke o novom načinu sakupljanja komunalnog otpada evidentno morati odgoditi.\r\n\r\nOcijenio je i da je uvođenje formulacije osobe koje menstruiraju, umjesto riječi žene, u zagrebački Program za mlade - nasilno.\r\n\r\nNasilno uvođenje ovog pojma, umjesto pojma žena, je vrlo žalosno i jedna velika uvreda za sve žene. Vodstvo Zagreba na čelu sa sektom koja je retrogradna i regresivna, nastoji ravnopravnost spolova bazirati na ovakvim temama koje smatramo smiješnima, istaknuo je HDZ-ov Mislav Herman .\r\n\r\nZamjerio je i gradonačelniku Tomislavu Tomaševiću što nije bio na utakmici Dinama, nego na koncertu grupe Iron Maiden.', , 'img/zagreb.JPG');
INSERT INTO `clanak` (`archive`, `clanak_id`, `author`, `category`, `heading`, `dateOfUpload`, `articleSummary`, `article`, `pic`, `img_path`) VALUES
(0, 37, 'mdrcic01', 'politika', 'Selak Raspudić tvrdi: Umjesto ', '2022-05-25 14:22:42', 'Zanimaju ih isključivo ideološke teme', 'A to je, objasnila je, da ne desnicu nego ljevicu zanimaju isključivo ideološke teme dok je nama u prvom planu borba protiv korupcije i raščišćavanje hrvatskog političkog prostora od koruptivnih aktivnosti da bismo onda mogli dalje nastaviti s razvojem društva u svim drugim smjerovima,.\r\n\r\nDo sada ozbiljnih razgovora, pregovora ili dogovora o suradnji uopće nije bilo, (...) već je to bio odgovor na načelno pitanje s obzirom na postotke i moguće suradnje, pojasnila je Selak Raspudić kako se ta tema pojavila u eteru.\r\n\r\nDodala je da bi isti odgovor bio za bilo što ako se razgovara o temeljnim problemima u Hrvatskoj.', , 'img/raspudic.JPG');
INSERT INTO `clanak` (`archive`, `clanak_id`, `author`, `category`, `heading`, `dateOfUpload`, `articleSummary`, `article`, `pic`, `img_path`) VALUES
(0, 38, 'mdrcic01', 'nekretnine', 'Ponudili im 230 eura po m2 za ', '2022-05-25 14:25:08', 'U imovinskoj kartici procijenio ju je na 3.05M kn', 'Vila s dvorištem ima ukupno 1077 kvadrata pa ispada da je krajem prošle godine viceguverner kupio nekretninu u zagrebačkom Gornjem Stenjevcu po cijeni od oko 230 eura po kvadratu, što je daleko ispod tržišne cijene. Šubić tvrdi da je do vile došao preko oglasa pa smo pogledali oglasnike i javili se agencijama s upitom oko kuća i vila otprilike iste veličine.\r\n\r\nNazvali smo nekoliko zagrebačkih agencija za prodaju nekretnina i ponudili oko 230 eura po kvadratu za nekretnine otprilike jednake veličine kao ona koju je Šubić kupio. Odgovori su uglavnom bili takvi da je nemoguće kupiti kuću, a kamoli vilu za te novce.', , 'img/vile.JPG');
INSERT INTO `clanak` (`archive`, `clanak_id`, `author`, `category`, `heading`, `dateOfUpload`, `articleSummary`, `article`, `pic`, `img_path`) VALUES
(0, 39, 'mdrcic01', 'nekretnine', 'Stiže li veliki pad cijena nek', '2022-05-25 14:26:48', 'Sve je više nekretnina, a sve manje ljudi', 'Kako su rasle cijene u Hrvatskoj i EU\r\nCijene nekretnina u Hrvatskoj su rasle 9% trećeg kvartala prošle godine u odnosu na 2020. To je u skladu s prosjekom EU od 9.2% i daleko manje od država unutar nje koje su imale rekordno visok rast cijena u tom razdoblju; Češke s 22% rasta cijena, Litve s 18.9%, Estonije 17.3% i Nizozemske s 16.8 % raste cijena nekretnina. \r\n\r\nRast cijena nekretnina je posebno dramatičan kada se promatra u dugoročnom razdoblju od 2010. do 2021. Rast je zabilježen u 23 zemlje EU, a pad u četiri, s najvećim rastom u Estoniji (+141%), Mađarskoj (+118%), Luksemburgu (+117%), Latviji (+106%) i Austriji (+104%) ). Pad je zabilježen u Grčkoj (-28%), Italiji (-12%), Cipru (-6%) i Španjolskoj (-0,5%). \r\n\r\nUkupni rast u cijelom tom razdoblju cijena nekretnina u Hrvatskoj iznosi gotovo 30%, što je manje od rasta na razini EU koji je iznosio 39%.\r\n\r\nDo 2017. cijene padale, nakon toga strelovito rastu\r\nAli taj rast nije bio kontinuiran iz godine u godinu. U Hrvatskoj su cijene padale svake godine od 2008. do 2016., a 2017. i 2020. snažno rastu. Najveći pad cijena, od čak 7.9%, zabilježen je 2009. i trend pojeftinjenja se nastavio do 2016.\r\n\r\nTe se godine cijene nekretnina oporavljaju blagim rastom od 2%, ali već sljedeće godine rast iznosi 2.9%, 2018. 4.6%, 2019. 7.8% i 2020. 7. %. Znači da je rast blago usporio 2020. u odnosu na 2019., ali po svemu sudeći se opet pojačao 2021. na rekordnih 9%.\r\n\r\nTo je daleko više od rasta dohotka i plaća koje su od 2017. rasle u prosjeku manje od 4% godišnje. Jasno je da nekretnine naglo postaju sve skuplje u odnosu na plaće, tj. sve je teže s plaćom i kreditom kupiti nekretninu.', , 'img/nekretnine.JPG');

